        public static List<Message> ListMessages(GmailService service, String userId, String query)
        {
            List<Message> result = new List<Message>();
            UsersResource.MessagesResource.ListRequest request = service.Users.Messages.List(userId);
            request.Q = query;
            
            do
            {
                try
                {
                    ListMessagesResponse response = request.Execute();
                    result.AddRange(response.Messages);
                    request.PageToken = response.NextPageToken;
                }
                catch (Exception e)
                {
                    Console.WriteLine("An error occurred: " + e.Message);
                    Console.ReadLine();
                }
            } while (!String.IsNullOrEmpty(request.PageToken));

            return result;
        }

        public static bool SendMessageToTrash(List<Message> lstMessages, GmailService service, string UserID)
        {
            bool result = true;

            foreach(var msg in lstMessages)
            {
                try
                {
                    var emailInfoRequest = service.Users.Messages.Get("email@gorillaexpense.com", msg.Id);
                    emailInfoRequest.Format = UsersResource.MessagesResource.GetRequest.FormatEnum.Full;
                    var emailInfoResponse = emailInfoRequest.Execute(); 
                  //  service.Users.Messages.Trash(UserID, msg.Id).Execute();

                    if (emailInfoResponse != null)
                    {
                      
                        

                        String from = "";
                        String date = "";
                        String subject = "";

                        IList<MessagePart> parts = emailInfoResponse.Payload.Parts;
                        //////////attachment
                        foreach (MessagePart part in parts)
                        {
                            if (!String.IsNullOrEmpty(part.Filename))
                            {
                                String attId = part.Body.AttachmentId;
                                MessagePartBody attachPart = service.Users.Messages.Attachments.Get("email@gorillaexpense.com", emailInfoResponse.Id, attId).Execute();

                                // Converting from RFC 4648 base64 to base64url encoding
                                // see http://en.wikipedia.org/wiki/Base64#Implementations_and_history
                                String attachData = attachPart.Data.Replace('-', '+');
                                attachData = attachData.Replace('_', '/');

                                byte[] data = Convert.FromBase64String(attachData);
                                // File.WriteAllBytes(Path.Combine(outputDir, part.Filename), data);
                            }
                        }
                        //////////attachment

                        //loop through the headers to get from,date,subject, body  
                        foreach (var mParts in emailInfoResponse.Payload.Headers)
                        {
                          


                            if (mParts.Name == "Date")
                            {
                                date = mParts.Value;
                            }
                            else if (mParts.Name == "From")
                            {
                                from = mParts.Value;
                            }
                            else if (mParts.Name == "Subject")
                            {
                                subject = mParts.Value;
                            }

                            if (date != "" && from != "")
