        public static Google.Apis.Gmail.v1.Data.Thread ModifyThread(GmailService service, String userId,
      String threadId)
        {
            List<String> labelsToRemove = new List<string>();
            labelsToRemove.Add("UNREAD");
            Google.Apis.Gmail.v1.Data.ModifyThreadRequest mods = new Google.Apis.Gmail.v1.Data.ModifyThreadRequest();
            mods.AddLabelIds = labelsToRemove;

            try
            {
                return service.Users.Threads.Modify(mods, userId, threadId).Execute();
            }
            catch (Exception e)
            {
               // EventLog.WriteEntry("GorillaAutoFeed", "GooglemailAPI ModifyThread -" + e.Message);
            }

            return null;
        }
