        public static string ConvertCidToByte(string cid, IList<MessagePart> parts, GmailService service , string MessageID)
        {
             byte[] data = null;
            string datastring="";
            foreach (MessagePart part in parts)
            {
                if (!String.IsNullOrEmpty(part.Filename) && cid == "cid:"+part.Filename)
                {
                    String attId = part.Body.AttachmentId;
                    MessagePartBody attachPart = service.Users.Messages.Attachments.Get("email@gorillaexpense.com", MessageID, attId).Execute();

                    // Converting from RFC 4648 base64 to base64url encoding
                    // see http://en.wikipedia.org/wiki/Base64#Implementations_and_history
                    String attachData = attachPart.Data.Replace('-', '+');
                    attachData = attachData.Replace('_', '/');

                 //   data = Convert.FromBase64String(attachData);

                    datastring = "data:" + part.MimeType + ";base64," + Convert.ToString(attachData);
                    // File.WriteAllBytes(Path.Combine(outputDir, part.Filename), data);
                }
            }

            return datastring;
        
        }

        public static byte[] FromBase64ForUrlString(string base64ForUrlInput)
        {
            int padChars = (base64ForUrlInput.Length % 4) == 0 ? 0 : (4 - (base64ForUrlInput.Length % 4));
            StringBuilder result = new StringBuilder(base64ForUrlInput, base64ForUrlInput.Length + padChars);
            result.Append(String.Empty.PadRight(padChars, '='));
            result.Replace('-', '+');
            result.Replace('_', '/');
            return Convert.FromBase64String(result.ToString());
        } 

